library(shiny)
library(shinydashboard)

ui <- dashboardPage(
  skin = "black",
  dashboardHeader(title = "Contenido"),
  
  dashboardSidebar(
    sidebarMenu(
      menuItem("Datos generales", tabName = "datos", icon = icon("info-circle")),
      menuItem("Ecuación", tabName = "ecuacion_conf", icon = icon("flask")),
      menuItem("Calculadora", tabName = "calculadora_aviso", icon = icon("calculator"))
    )
  ),
  
  dashboardBody(
    withMathJax(),
    tabItems(
      
      # Sección: Datos generales
      tabItem(tabName = "datos",
              h2("Estimacion de sexo en coxal (cualitativo)"),
              h3("Datos generales"),
              p("Esta calculadora se basa en los resultados del siguiente estudio:"),
              strong("Artículo:"),
              p("Gómez-Valdés, J.A., Menéndez-Garmendia, A., García-Barzola, L., Sánchez-Mejorada, G., Karam, C. 2017. Recalibration of the Klales et al. (2012) method of sexing the human innominate for mexican populations.",
                em("American Journal of Physical Anthropology"), ", pp. 1-5."),
              strong("Población de referencia:"),
              p("Muestra de 203 individuos adultos (91 mujeres y 112 hombres) con un rango de edad de 19 a 108 años, provenientes de contextos geográficos diversos."),
              strong("Método:"),
              p("Aplicación del método morfoscópico de Klales en el hueso coxal.")
      ),
      
      # Sección: Ecuación y Confiabilidad
      tabItem(tabName = "ecuacion_conf",
              h3("Ecuación seleccionada"),
              p("La ecuación que presentó la mayor exactitud en el estudio es una versión recalibrada de la ecuación de regresión logística propuesta por Klales et al. (2012), y se expresa de la siguiente forma:"),
              helpText("$$Sexo = 18.667 \\times VA + 30.361 \\times MA + 12.334 \\times SP - 168.376$$"),
              p("Donde:"),
              tags$ul(
                tags$li("VA = Arco ventral"),
                tags$li("MA = Aspecto medial de la rama isquio-púbica"),
                tags$li("SPC = Contorno subpúbico"),
              ),
              br(),
              img(src = "Coxal_quali.png", height = "300px"),
              div(
                style = "width:500px; font-size:12px;",
                p(
                  "Observaciones hechas en el coxal. Contorno subpúbico (SPC), aspecto medial de la rama isquio-púbica (MA), arco ventral (VA).",
                  "Imagen tomada de Klales, et al. 2012."
                )
              ),
              br(),
              strong("Confiabilidad:"),
              br(),
              strong("Error intra- e inter-observador:"),
              p("No se evaluó el error intra- e inter-observador."),
              strong("Exactitud:"),
              p("La ecuación reporta una exactitud del 100%.")
      ),
      
      # Sección: Calculadora y Aviso
      tabItem(tabName = "calculadora_aviso",
              h3("Calculadora"),
              p("A continuación, introduce las medidas requeridas en milímetros:"),
              numericInput("numericVA", "Arco ventral (VA)", value = NULL),
              numericInput("numericMA", "Rama isquio-púbica (MA)", value = NULL),
              numericInput("numericSPC", "Contorno subpúbico (SPC)", value = NULL),
              
              br(),
              h4("El resultado es:"),
              verbatimTextOutput("sexResult"),
              br(),
              h4("La probabilidad de ser un individuo de sexo femenino calculado a partir de la ecuación es:"),
              verbatimTextOutput("sexResult_pF"),
              br(),
              h4("La probabilidad de ser un individuo de sexo masculino calculado a partir de la ecuación es:"),
              verbatimTextOutput("sexResult_pM"),
              br(), br(),
              h3("Aviso de responsabilidad"),
              div(
                style = "text-align:justify;",
                p("Esta calculadora tiene fines exclusivamente informativos y académicos.", 
                  "Se basa en datos publicados y no sustituye el juicio profesional en contextos médicos, forenses o legales.",
                  "Los desarrolladores de esta herramienta no se hacen responsables por el uso, interpretación o consecuencias derivadas de los resultados obtenidos a través de esta calculadora."), 
              )
      )
    )
  )
)


server <- function(input, output, session) {
  
  current_valueVA <- reactive(input$numericVA)
  current_valueMA <- reactive(input$numericMA)
  current_valueSPC <- reactive(input$numericSPC)
  
  current_valueSEX <- reactive({
    req(current_valueVA(), current_valueMA(), current_valueSPC())
    (16.370 * current_valueVA()) + (15.842 * current_valueMA()) + (14.978 * current_valueSPC()) - 125.185
  })
  
  current_valueSEX2 <- reactive({
    val <- current_valueSEX()
    if (is.na(val)) {
      ""
    } else if (val < 0) {
      "Femenino"
    } else {
      "Masculino"
    }
  })
  
  
  current_valueProbF <- reactive({
    val2 <- current_valueSEX()
    if (is.na(val2)) {
      ""
    } else {
      (1 / ( 1 + exp(current_valueSEX()) ) )
    }
  }
  )
  
  current_valueProbM <- reactive({
    val3 <- current_valueSEX()
    if (is.na(val3)) {
      ""
    } else if (current_valueProbF() == 1) {
      "0"
    } else {
      (1 - current_valueProbF())
    }
  }
  )
  
  output$sexResult <- renderText({
    current_valueSEX2()
  })
  
  output$sexResult_pF<- renderText({
    current_valueProbF()
  })
  
  output$sexResult_pM<- renderText({
    current_valueProbM()
  })
  
  
}



shinyApp(ui, server)
